import { Routes, Route } from "react-router-dom";
import WebNav from "./components/navbar/WebNav";
import Home from "./pages/Home";
import NotFound from "./pages/NotFound";
import Thanks from "./pages/Thanks";
import SignIn from './Authentication/SignIn';
import Register from './Authentication/Register';
import notfound from './pages/NotFound';
import './assets/App.css'

function App() {
  return (
    <>
    <WebNav />

    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="*" element={<NotFound />} />

      <Route path="/thanks" element={<Thanks />} />
      <Route path="/cabs" element={<Home />} />
      <Route path="/sign-in" element={<SignIn />} />
      <Route path="/register" element={<Register />} />
      <Route path="/notfound" element={<NotFound />} />
    </Routes>
    <div className="bottom-bar">
      <Link to="/" className="bottom-bar-item">
        <i className="fas fa-home"></i>
        <span>Home</span>
      </Link>
      <Link to="/search" className="bottom-bar-item">
        <i className="fas fa-search"></i>
        <span>Search</span>
      </Link>
      <Link to="/bookings" className="bottom-bar-item">
        <i className="fas fa-bookmark"></i>
        <span>Bookings</span>
      </Link>
      <Link to="/profile" className="bottom-bar-item">
        <i className="fas fa-user"></i>
        <span>Profile</span>
      </Link>
    </div>
    </>
  );
}

export default App;
